import { Link, NavLink } from "react-router-dom";

// ----- Import fichier de style -----
import './Header.scss';

// ----- Import logo -----
import Logo from '../assets/logo.png'

// ----- Composant Header -----
function Header() {
    return (
        <nav>
            <Link to="/">
            <img className='HomeLogo' alt='Logo de kasa' src={Logo} />
         </Link>
            <h1>En-tête de page</h1>
        </nav>
    )
}

export default Header
